import React, { useEffect, useState } from 'react';
import Style from '../Openings/Openings.module.css';
import { Heading } from '../Heading/Heading';
import { Button } from '../Button/Button';

export const Openings = () => {
  const [openingsJson, setOpeningsJson] = useState([]);
  const [openingIndex, setSelectedOpeningIndex] = useState(null);
  const [view, setView] = useState(false);

  const viewDetails = (openingIndex) => {
    setView(true);
    setSelectedOpeningIndex(openingIndex);
  }

  const backBtn = () => {
    setView(false);
  }

  useEffect(() => {
    fetchCallForOpenings();
  }, []);

  const fetchCallForOpenings = () => {
    fetch("http://localhost:8080/JobVista/GetOpenings", {
      method: 'GET',
      headers: {
        'Content-type': 'Application/JSON'
      }
    })
      .then(response => {
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        return response.json();
      })
      .then(result => {
        console.log("Fetched data:", result);
        console.log("Departments:", result.Value);
        setOpeningsJson(result.Value);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }

  useEffect(() => {
    console.log("json: " + openingsJson);
  }, []);

  return (
    <div>

      {!view && openingsJson && (
  <div id={Style.applicants}>
    <Heading>Openings</Heading>

    <table>
      <thead>
        <tr className={Style.openingTr}>
          <th>Opening Name</th>
          <th>Qualification</th>
          <th>Experience</th>
          <th>Employment Type</th>
          <th>Salary Range</th>
          <th>Start_Date</th>
          <th>End_Date</th>
          <th>Department Name</th>
        </tr>
      </thead>
      <tbody>
        {openingsJson.map((item, index) => (
          <tr key={index} onClick={() => viewDetails(index)}>
            <td>{item.Opening.description}</td>
            <td>{item.Opening.qualification}</td>
            <td>{item.Opening.experience}</td>
            <td>{item.Opening.employmentType}</td>
            <td>{item.Opening.salaryRange}</td>
            <td>{item.Opening.startDate}</td>
            <td>{item.Opening.endDate}</td>
            <td>{item.Opening.departments}</td>
          </tr>
        ))}
      </tbody>
    </table>
  </div>
)} {view && openingIndex !== null && (
  <div>
    <div id={Style.applicantDiv}>
      <Heading className={Style.title}><i onClick={backBtn} class="fa-regular fa-circle-left"></i>Tests</Heading>
      {/* <Button onClick={backBtn}>Back</Button> */}
    </div>
    <table>
      <thead>
        <tr className={Style.openingTr}>
          <th>Test Title</th>
          <th>Date</th>
          <th>Duration</th>
        </tr>
      </thead>
      <tbody>
      {openingsJson[openingIndex].Test && Object.keys(openingsJson[openingIndex].Test).length > 0 ? (
          <tr>
            <td>{openingsJson[openingIndex].Test.testTitle}</td>
            <td>{openingsJson[openingIndex].Test.testDate}</td>
            <td>{openingsJson[openingIndex].Test.testDuration}</td>
          </tr>
        ) : (
          <tr>
            <td colSpan="3">No tests available</td>
          </tr>
        )}
      </tbody>
    </table>
  </div>
)}

{view && openingIndex !== null && (
  <div>
    <div id={Style.applicantDiv}>
      <Heading className={Style.title}><i onClick={backBtn} className="fa-regular fa-circle-left"></i>Panelists</Heading>
      {/* <Button onClick={backBtn}>Back</Button> */}
    </div>
    <table>
      <thead>
        <tr className={Style.openingTr}>
          <th>Name</th>
          <th>Email</th>
          <th>Position</th>
          <th>Gender</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>{openingsJson[openingIndex].Panelist.panelistName}</td>
          <td>{openingsJson[openingIndex].Panelist.panelistEmail}</td>
          <td>{openingsJson[openingIndex].Panelist.panelistPosition}</td>
          <td>{openingsJson[openingIndex].Panelist.panelistGender}</td>
        </tr>
      </tbody>
    </table>
  </div>
)}



      </div>
  )
}
